import React from "react";
import '../styles/home.css'
const Information = () => {
  return (
    <section className="info">
      <h2>Why Donate Blood?</h2>
      <p>
        Every year, millions of lives are saved thanks to blood donors. Your
        donation can help save lives in emergencies.
      </p>
    </section>
  );
};

export default Information;
